    // Function to create pairs of every 10th latitude and longitude
    function createPairs(data) {
        const pairs = [];
        const firstLatLng = `${data[0].longitude},${data[0].latitude}`;
        pairs.push(firstLatLng);
        for (let i = 1; i < data.length; i += 9) {
            const latLng = `${data[i].longitude},${data[i].latitude}`;
            pairs.push(latLng);
        }
        const lastLatLng = `${data[data.length - 1].longitude},${data[data.length - 1].latitude}`;
        if (!pairs.includes(lastLatLng)) {
                pairs.push(lastLatLng);
            }
        console.log(pairs)
        return pairs;
    }

    // Function to send request to OSRM Match Service
    async function sendOsrmRequest(lngLats) {
        const radiuses = Array(lngLats.length).fill('49');
        const url = `http://localhost:5000/match/v1/bicycle/${lngLats.join(';')}?overview=full&radiuses=${radiuses.join(';')}&geometries=geojson&annotations=true`;

        try {
            const response = await fetch(url);
            const data = await response.json();

            processOsrmData(data);
            console.log(data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    }

    // Function to process OSRM data and plot polyline
    function processOsrmData(data) {
        if (data.code === 'Ok' && data.matchings && data.matchings.length > 0) {
            const coordinates = data.matchings[0].geometry.coordinates;
            const latLngs = coordinates.map(coordinate => [coordinate[1], coordinate[0]]);
            plotPolyline(latLngs);
        } 
        else {
            console.error('OSRM response is not as expected:', data);
        }
    }

    // Function to plot polyline on the map
    function plotPolyline(latLngs) {
        const polyline = L.polyline(latLngs, { color: 'blue' }).addTo(map);
        map.fitBounds(polyline.getBounds());
    }

    // Create pairs and send OSRM requests
    const lngLatPairs = createPairs(jsonData);
    sendOsrmRequest(lngLatPairs);
